import React from "react";
import CoverImg from "../../Assests/Images/background/bg-1.png";
import UserImg from "../../Assests/Images/user/sha.jpeg";

function Profile() {
  return (
    <div className="card">
      <img src={CoverImg} className="card-img-top profilecover" alt="Background Cover" />
      <div class="position-relative">
        <div class="position-absolute top-50 start-50 translate-middle w-50">
          <img src={UserImg} className="card-img-top rounded-circle" alt="Background Cover" />
        </div>
      </div>
      <div class="card-body mt-4 text-center">
      <h6 href="/edcwe" class="card-title pt-3"><a className="text-decoration-none link-dark" href="/profile">Samiksha Moghan</a></h6>
        <p class="card-text ">
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </p>
      </div>
    </div>
  );
}

export default Profile;
